; word-break: break-all;\">https://www.hyundai.com/worldwide/ko/brand-journal/ioniq/ioniq-9-teaser</a></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><br style=\"text-size-adjust: none;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">자사가 직접 홈페이지에 티저를 공개하면서.. 조금더 이슈를 보이려는모습이 신선하긴합니다..;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><br style=\"text-size-adjust: none;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><img alt=\"터빈을 닮아 속도와 역동성이 느껴지는 휠 디자인\" src=\"https://www.hyundai.com/content/dam/hyundai/ww/en/images/brand-journal/ioniq/241030-ioniq-9/hyundai-ioniq9-teaser-01-rim-pc.jpg\" class=\"fr-fic fr-dii\" style=\"text-size-adjust: none; border-radius: 0.33em; border: 0px; margin: 0px; height: auto !important; max-width: 740px !important;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><br style=\"text-size-adjust: none;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><img alt=\"파라메트릭 픽셀을 갖춘 램프 디자인.\" src=\"https://www.hyundai.com/content/dam/hyundai/ww/en/images/brand-journal/ioniq/241030-ioniq-9/hyundai-ioniq9-headlights-03-pc.jpg\" class=\"fr-fic fr-dii\" style=\"text-size-adjust: none; border-radius: 0.33em; border: 0px; margin: 0px; height: auto !important; max-width: 740px !important;\"><img alt=\"한복 동정을 닮은 측면 캐릭터 라인의 모습\" src=\"https://www.hyundai.com/content/dam/hyundai/ww/en/images/brand-journal/ioniq/241030-ioniq-9/hyundai-ioniq9-character-04-pc.jpg\" class=\"fr-fic fr-dii\" style=\"text-size-adjust: none; border-radius: 0.33em; border: 0px; margin: 0px; height: auto !important; max-width: 740px !important;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><br style=\"text-size-adjust: none;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><br style=\"text-size-adjust: none;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">아이오닉 9의 디자인은 물의 저항을 최소화하는 날렵한 외관과 넓고 아늑한 실내 공간을 동시에 품고 있는 보트(Boat)에서 영감을 받았다. &nbsp;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">현대자동차는 이를 바탕으로 아이오닉 9에 공기 흐름을 최적화하고 여유로운 공간을 제공하는 ‘에어로스테틱(Aerosthetic)’ 실루엣을 연출했다. 에어로스테틱은 공기 역학을 의미하는 ‘에어로다이나믹(Aerodynamic)’과 미학을 뜻하는 ‘에스테틱(Aesthetic)’의 합성어로 공력의 미학을 담은 디자인을 말한다.&nbsp;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">아이오닉 9에 적용된 에어로스테틱 실루엣은 차량 주요 코너부와 루프 라인을 매끄러운 곡선 형상으로 처리해 공기 유동이 차량 전체를 부드럽게 감싸며 세련된 이미지를 구현하는 동시에 공력 성능 향상에 도움을 준다.</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">특히, 차량 앞좌석부터 뒷좌석까지 모든 탑승자가 넉넉한 헤드룸 공간을 누릴 수 있도록 유려한 곡선으로 설계된 루프 라인은 긴 휠베이스와 어우러져 넉넉한 실내 공간을 갖추고 있음을 암시한다. &nbsp; &nbsp;&nbsp;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">또한 아이오닉 9은 전면부 램프에 전용 전기차 아이오닉의 핵심 디자인 요소인 파라메트릭 픽셀이 적용됐으며 뒷부분 휠 아치 위를 대각선으로 감싼 차량 측면의 캐릭터 라인이 인상적이다. 여기에 멀티스포크 휠은 터빈을 닮아 시각적으로 속도감과 역동성을 느끼게 해준다.&nbsp;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">현대자동차는 다음달 아이오닉 9의 디자인, 상품성 등을 세계 최초로 공개하는 행사를 진행할 예정이다.&nbsp;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">현대자동차 관계자는 “아이오닉 9은 에어로스테틱 실루엣을 통해 전동화 대형 SUV 디자인을 재정의했다”며 “공기역학적인 성능과 세련된 아름다움의 완벽한 융합을 보여준다”고 말했다.</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">한편, 현대자동차는 E-GMP에 기반한 동급 최고 수준의 전동화 상품성을 갖춘 아이오닉 차량을 통해 전기차 시장에서 글로벌 톱티어 브랜드로서 입지를 강화해 나가고 있다.&nbsp;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">올해 9월 현대자동차는 1억대 누적 생산을 기록했으며 1억 1번째 차량으로 아이오닉 5를 생산함으로써 전동화 시장을 이끌어 나가겠다는 강한 의지를 표명했다.&nbsp;</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">또한 아이오닉 5와 아이오닉 6는 월드카 어워즈에서 세계 올해의 자동차를 수상하는 등 세계적으로 권위있는 시상식을 석권하며 우수한 전동화 기술력을 인정받았다.</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\">현대자동차는 전동화 라인업을 확장하는 대형 SUV 모델인 아이오닉 9을 통해 전동화 리더십을 공고히 하고 전기차 판매를 확대해 나갈 계획이다.</p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><br style=\"text-size-adjust: none;\"></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><a href=\"https://www.hyundai.co.kr/news/CONT0000000000163564\" target=\"_blank\" style=\"text-size-adjust: none; color: rgb(0, 0, 139); cursor: pointer; word-break: break-all;\">https://www.hyundai.co.kr/news/CONT0000000000163564</a></p><p style=\"text-size-adjust: none; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; position: relative !important; line-height: 1.7 !important; font-family: Roboto, &quot;Noto Sans KR&quot;, 나눔고딕, &quot;Nanum Gothic&quot;, &quot;Malgun Gothic&quot;, 맑은고딕, 굴림, 돋움, Dotum, &quot;sans-serif&quot; !important;\"><img src=\"/comunity/res/upload/4/1731306295020-4.jpg\" style=\"width: 697px;\"><br style=\"text-size-adjust: none; color: rgb(17, 17, 17); font-size: 15px;\"></p>',0,'2024-11-11 15:24:57',0,'새소식',0);
